import React from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import "../css/Home.css";
import logo from "../img/logo.png";

function Welcome() {

    setTimeout(() => {
        document.getElementById("intro-div").classList.toggle("hidden");
    }, 250);

  return (
    <table className="index index-odd text-center">
      <tbody>
        <tr>
          <td>
            <div className="initial-intro hidden" id="intro-div">
              <img
                className="initial-pic"
                src={logo}
                alt="Banner for devonmartin.net"
              />
              <h2>Hey. I'm Devon.</h2>
              <h2>I'm a self-taught software engineer.</h2>
              <div>
                <Link
                  to="#index-1"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                {/* <a className="" href="#index-1"> */}
                  Who?
                {/* </a> */}
                </Link>
              </div>
            </div>
          </td>
        </tr>
      </tbody>
    </table>
  );
}

export default Welcome;
